package dto;

public class DetailpageMapDTO {
private int unique_num;
private String foodstore_id;
private String address;
private String latitude;
private String longitude;


public DetailpageMapDTO() {
	// TODO Auto-generated constructor stub
}


public int getUnique_num() {
	return unique_num;
}


public void setUnique_num(int unique_num) {
	this.unique_num = unique_num;
}


public String getFoodstore_id() {
	return foodstore_id;
}


public void setFoodstore_id(String foodstore_id) {
	this.foodstore_id = foodstore_id;
}


public String getAddress() {
	return address;
}


public void setAddress(String address) {
	this.address = address;
}


public String getLatitude() {
	return latitude;
}


public void setLatitude(String latitude) {
	this.latitude = latitude;
}


public String getLongitude() {
	return longitude;
}


public void setLongitude(String longitude) {
	this.longitude = longitude;
}




}
